import React from "react";
import { Chart } from "react-google-charts";
import { mockLineData as data} from "./data";

const StatTable = () => {
  const options = {
    title: "Company Performance",
    curveType: "function",
    legend: { position: "bottom" },
  };
  return (
    <Chart
      chartType="LineChart"
      width="100%"
      height="400px"
      data={mockLineData}
      options={options}
    />
  );
};

export default StatTable;
